pub enum ChainStatus {
    Moving {
        block_height: u64,
    },
    Syncing,
    WaitingToStart,
}

pub enum LatestBlock {
    Latest {
        block: Block,
    },
    Syncing {
        block: Block,
    },
    WaitingToStart,
}

pub enum DecimalError {
    ExcessivePrecision,
    InvalidPrecision,
    DecimalError(DecimalLibraryError),
}

pub enum CosmosGrpcError {
    NoToken,
    BadResponse(String),
    BadStruct(String),
    SigningError {
        error: PrivateKeyError,
    },
    ConnectionError {
        error: TonicError,
    },
    RequestError {
        error: Status,
    },
    DecodeError {
        error: DecodeError,
    },
    BadInput(String),
    ChainNotRunning,
    NodeNotSynced,
    InvalidPrefix,
    NoBlockProduced {
        time: Duration,
    },
    TransactionFailed {
        tx: TxResponse,
        time: Duration,
    },
    InsufficientFees {
        fee_info: FeeInfo,
    },
}

pub enum FeeInfo {
    InsufficientFees {
        min_fees: Vec<Coin>,
    },
    InsufficientGas {
        amount: u64,
    },
}
